INSERT INTO `faqs` (`id`, `title`, `content`, `created_at`, `updated_at`, `category`) VALUES
(1, 'How do I sign up?', '<p>You will be asked to sign upfor free by using your LinkedIn or Facebook account. Please stay assured that tod-Z will not share your personal and contact information on your Profile page.</p>', '2020-07-27 23:29:59', '2020-07-27 23:31:22', 'Talent=> todder'),
(2, 'How do I receive a project?', '<p>When you have your Profile created after being accepted, you will be pitched by the project owners , they will discuss with you their project requirements and wait for an offer from your side indicating how much hours you will be able to accomplish their project within. Accordingly the Project owner will select the suitable talent for his project.</p>', '2020-07-27 23:32:01', '2020-07-27 23:32:01', 'Talent=> todder'),
(3, 'How do I check and change my account details?', '<p>Once you <a href=\"https://tod-z.com/talent/login\">log in</a>to your tod-Z account, you will be able to change your account information in the account settings.Please note that since your ID will be shown as anonymous, some personal details will not be allowed to change. Please be careful when you fill in your personal information in the beginning.</p>', '2020-07-27 23:32:41', '2020-07-27 23:32:41', 'Talent=> todder'),
(4, 'Why has my account  been suspended?', '<p>Here are a few reasons for accountssuspension:</p>\r\n\r\n<p>Themost likely reason for suspending a user&#39;s account:</p>\r\n\r\n<p>Posting personal contact information or links to contact information is related to violating&nbsp; Todder Terms and conditions. This is the most common reason for account suspension. Revealing your identity is by no means allowed on tod-Z.</p>\r\n\r\n<p>Please read&nbsp; ourTodder Terms and Conditions Carefully.</p>\r\n\r\n<p>If you have any further questions or want to discussyour account suspension, please contact us.</p>', '2020-07-27 23:33:28', '2020-07-27 23:33:28', 'Talent=> todder'),
(5, 'How to deactivate my account?', '<p>Meanwhile we don&rsquo;t have account deactivation option , however we are working on it and will be available on your account update soon.</p>', '2020-07-27 23:33:54', '2020-07-27 23:33:54', 'Talent=> todder'),
(6, 'How many assessments do I need to take?', '<p>You are required to clear 2 assessments after the profile screening.</p>\r\n\r\n<p>This involves a Cognitive assessment offered by our partner Bryq and technical test offered by ourpartner ExpertRating.Once you clear the assessments, there will be a final live personal interview and upon acceptance you will be able to be a todder on our platform and start receiving project pitches.</p>', '2020-07-27 23:38:03', '2020-07-27 23:38:03', 'Talent â€“ Assessment:');
